import React from 'react';
function Universe() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-4' style={{width:"100000%"}}>
                    <img src='media/zerodhaFundhouse.png' alt='' />
                    <p className='text-muted'>Thenatic investment platform</p>
                </div>
                <div className='col-4'>
                    <img src='media/sensibullLogo.png' alt='' />
                    <p className='text-muted'>Thematic investment platform</p>
                </div>
                <div className='col-4'>
                    <img src='media/dittoLogo.png' alt='' />
                    <p className='text-muted'>Thenatic investment platform</p>
                </div>

            </div>
        </div>
    );
}

export default Universe;
